import React, { useState } from "react";
import { TextField } from "@mui/material";
import { useLocation, useNavigate } from "react-router-dom";

function Order() {
  const navigate = useNavigate();
  const location = useLocation();
  const [form, setForm] = useState({
    firstName: "",
    lastName: "",
    phoneNumber: "",
    email: "",
    zipcode: 0,
    pickUpDate: Date,
    pickupTime: Date,
    numberOfServings: 0,
    orderType: "",
    flavor: "",
    orderDetails: "",
    refPictures: "",
  });
  return (
    <div className="py-7">
      <div className="bg-white w-2/4 h-[535px] rounded-md flex flex-row justify-around mr-auto ml-auto pl-12">
        <form
          style={{
            display: "flex",
            flexDirection: "column",
            maxWidth: "300px",
            margin: "auto",
            height: "80%",
            gap:"3rem"
          }}
        >
          <h1 className="text-2xl font-semibold py-3">Let's Get You Cake!</h1>
          <TextField
            label="First Name"
            type="text"
            variant="outlined"
            name="firstName"
            value={form.firstName}
          />
           <TextField
            label="Last Name"
            type="text"
            variant="outlined"
            name="lastName"
            value={form.lastName}
          />
           <TextField
            label="Pickup Date"
            type="date"
            variant="outlined"
            name="date"
            value={form.pickUpDate}
          />
           <TextField
            label="Pickup Time"
            type="time"
            variant="outlined"
            name="time"
            value={form.pickupTime}
          />
        </form>
      </div>
    </div>
  );
}

export default Order;
